import React from "react";

function Home() {
  return (
    <div>
      <h1>Welcome to the home of my React projects</h1>
      <p>
        My name is Jabez Dailey, and currently as I am writing this I am a
        senior computer science student at Morehouse College. This react
        assignment is created to be the final for my HCSC 419 class, and to hold
        all the work I have completed during this class.
      </p>
    </div>
  );
}

export default Home;
